script: |
  super -f text -I q5857.spq | sort > q5857.out

inputs:
  - name: q5857.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE NOT - 81 + + col2 BETWEEN ( 82 * + 83 ) AND ( CAST ( NULL AS INTEGER ) * + col2 );
  - name: tab1

outputs:
  - name: q5857.out
    data: |
      51	14	96
      85	5	59
      91	47	68
